def replaceElements(arr):
    """
    :type arr: List[int]
    :rtype: List[int]
    """
    ansList = [-1] * len(arr)
    
    j = 1
    while j < len(arr):
        currentMax = arr[j]
        for i in range(j, len(arr)):
            currentMax = max(currentMax, arr[i])
        
        ansList[j-1] = currentMax
        j += 1
    
    return ansList

